import { Col, Container, Row } from "react-bootstrap";

function Home() {
  return (
    <>
      <Container
        style={{
          display: "flex",
          width: "100%",
          height: "100%",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Row>
          <Col>
            <h1>Welcome to App</h1>
          </Col>
        </Row>
      </Container>
    </>
  );
}
export default Home;
